import React, { Component } from "react";

class Home extends Component{
    render(){
        return(
            <div className="home min-h-100 p-t-15p">
                <div className="w-40 bg-0D3843 p-30 b-rad-30">
                    <h1 className="t-center f-c-fff">I am Eka Prayoga</h1>
                    <p className="p-t-30 f-s-18 f-c-fff t-center">I am a <span className="f-w-700">Web Administrator / Frontend Web Developer</span> and I mainly use HTML, CSS, and Javascript to develop pages. Recently, I am learning on React JS as framework to develop my Frontend skills</p>
                </div>
            </div>
        );
    }
}

export default Home;
